// src/App.jsx
import React from 'react';
import Header from './components/Header';
import TransactionTable from './components/TransactionTable';
import AvailableBalances from './components/AvailableBalances';
import RevenueSources from './components/RevenueSources';
import { Tabs, TabsList, TabsTrigger, TabsContent } from '@ark-ui/react';
import './App.module.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Tabs defaultValue="transactions">
        <TabsList>
          <TabsTrigger value="transactions">Transacciones</TabsTrigger>
          <TabsTrigger value="balances">Saldos Disponibles</TabsTrigger>
          <TabsTrigger value="revenueSources">Fuentes de Ingresos</TabsTrigger>
        </TabsList>

        <TabsContent value="transactions">
          <TransactionTable />
        </TabsContent>
        <TabsContent value="balances">
          <AvailableBalances />
        </TabsContent>
        <TabsContent value="revenueSources">
          <RevenueSources />
        </TabsContent>
      </Tabs>
    </div>
  );
}

export default App;
